import React from "react";
import { Button } from "antd";
import {
  CheckCircleOutlined,
  EditOutlined,
  SaveOutlined,
  FilterOutlined,
  LoginOutlined,
  UserAddOutlined,
  SearchOutlined,
  HomeOutlined,
  SendOutlined,
} from "@ant-design/icons";

export const ButtonEdit = (props) => (
  <Button {...props} icon={<EditOutlined />}>
    Modifier
  </Button>
);

export const ButtonSave = (props) => (
  <Button {...props} icon={<SaveOutlined />}>
    Enregistrer
  </Button>
);

export const ButtonCheck = (props) => (
  <Button {...props} icon={<CheckCircleOutlined />}>
    Valider
  </Button>
);

export const ButtonSend = (props) => (
  <Button {...props} icon={<SendOutlined />}>
    Envoyer
  </Button>
);

export const ButtonSearch = (props) => (
  <Button {...props} icon={<SearchOutlined />}>
    Rechercher
  </Button>
);

export const ButtonFilter = (props) => (
  <Button icon={<FilterOutlined />} {...props}>
    Filtrer
  </Button>
);

export const ButtonLogin = (props) => (
  <Button {...props} icon={<LoginOutlined />}>
    Se connecter
  </Button>
);

export const ButtonRegister = (props) => (
  <Button {...props} icon={<UserAddOutlined />}>
    S'inscrire
  </Button>
);

export const ButtonHome = (props) => (
  <Button {...props} icon={<HomeOutlined />}>
    Accueil
  </Button>
);
